column5:
#Tigray #Exam

рІерЅхрїЇрѕФрІГ ріГрѕЇрѕЇ рЅарЅђрІхрѕъ рѕхрѕГрІЊрЅ░ рЅхрѕЮрѕЁрѕГрЅх рІерЅ░рѕЏрѕЕріЊ рЅа2013 ріЦріЊ рЅа2014 рІерЅхрѕЮрѕЁрѕГрЅх рІўрѕўріЋ рѕўрЇѕрЅ░ріЋ рІеріљрЅарѕерЅБрЅИрІЇ рЅ░рЇѕрЅ│ріъ рЅа2016 рЅхрѕЮрѕЁрѕГрЅх рІўрѕўріЋ рЅарІѕрѕерЅђрЅхріЊ рЅарЅарІГріљ рѕўрѕерЅЦ рІерѕџрЇѕрЅ░ріЉрЅарЅх рѕўрѕГрѕЃ рїЇрЅЦрѕГ ріерѕІрІГ рЅ░рІФрІГрІЪрѕЇрЇб

@tikvahethiopia

#рЅЦрѕћрѕФрІірЇѕрЅ░ріЊ

ріерЅхрїЇрѕФрІГ ріГрѕЇрѕЇ рІЇрїГ рЅарѕЂрѕЅрѕЮ ріГрѕЇрѕјрЅйріЊ рЅаріерЅ░рѕЏ ріарѕхрЅ░рІ│рІ░рѕ«рЅй рѕІрѕЅ рЅ░рЇѕрЅ│ріърЅй рЅарІѕрѕерЅђрЅх ріЦріЊ рЅарЅарІГріљ рѕўрѕерЅЦ (рідріЋрѕІрІГріЋ) рІерѕџрѕ░рїарІЇ рІерЇѕрЅ░ріЊ рѕўрѕГрѕЃ рїЇрЅЦрѕГ ріерѕІрІГ рЅ░рІФрІГрІЪрѕЇрЇб

@tikvahethiopia

рІерІ░рЅАрЅЦріЊ рѕЮрІЋрѕФрЅЦ ріарЇЇрѕфріФ ріарѕЁрїЅрѕе рѕхрЅЦріерЅх рІІріЊ рѕЦрѕФ ріарѕхріфрІФрїЁ┬а рѕірЅђ рѕЏріЦрѕЮрѕФріЋ рЅЦрѕГрѕЃріЉ рЅ░ріГрѕѕ рІФрѕгрІх рЅарІЏрѕгрІЇ рІЋрѕѕрЅх ріерїарІІрЅ▒ 12:00 рЅарЇїрІ┤рѕФрѕЇ рЇќрѕірѕх " #рѕѕрїЦрІФрЅё_рІГрЇѕрѕѕрїІрѕЅ " рЅарѕџрѕЇ ріерЅцрЅ│рЅИрІЇ рЅ░рІѕрѕхрІ░рІЇ рѕўрЅ│рѕарѕФрЅИрІЇріЋ рЅцрЅ░рѕ░рЅдрЅ╗рЅИрІЇ рѕўріЊрїѕрѕФрЅИрІЇріЋ рЅ░рІІрѕЋрІХ рѕџрІ▓рІФ рѕЏрІЋріерѕЇ рІўрїЇрЅДрѕЇрЇб

рЅђрІ░рѕЮ рЅЦрѕј рЇЦ рІерѕ░ріЋрЅарЅх рЅх/ рЅцрЅХрЅй рѕЏрІ░рѕФрїЃ рѕўрѕЮрѕфрІФ рѕЏріЁрЅарѕе рЅЁрІ▒рѕ│ріЋ рѕ░рЅЦрѕ│рЅб рІерѕєріЉрЅх рѕірЅђ рЅхрїЅрѕЃріЋ рЅђрѕ▓рѕх рІХріГрЅ░рѕГ рѕЎрѕЅрїїрЅ│ рѕхрІЕрѕЮ ріЦріЊ рІерѕЏріЁрЅарѕе рЅЁрІ▒рѕ│ріЋ рІІріЊ рїИрѕљрЇі рѕўрѕЮрѕЁрѕГ рІІрѕ▓рѕЂріЋ рЅарѕІрІГ ріерЅцрЅ│рЅИрІЇ рЅарїИрїЦрЅ│ ріЃрІГрѕЇ рѕўрІѕрѕ░рІ│рЅИрІЇріЊ рЅцрЅ│рЅИрІЇ рѕІріГ рЇЇрЅ░рѕ╗ рѕўрІ░рѕерїЅріЋ рІерѕЏріЁрЅарѕе рЅЁрІ▒рѕ│ріЋ рЅ┤рѕїрЅфрІЦріЋ рѕўрІЮрїѕрЅА рІГрЅ│рІѕрѕ│рѕЇрЇб

@tikvahethiopia

рЅаріарІ▓рѕх ріарЅарЅБ ріерЅ░рѕЏ ріерЅхрѕІріЋрЅх рѕѕрѕірЅх ріаріЋрѕхрЅХ ріерЅарІх рІФрѕѕ рІЮріЊрЅЦ рѕ▓рїЦрѕЇ ріљрЅарѕГрЇб

рІЏрѕг ріЋрїІрЅх рѕІрІГ рЅарЅ░ріерѕ░рЅ░ рІерїјрѕГрЇЇ ріарІ░рїІ рІ░рїЇрѕъ рЅарЅдрѕї ріГ/ріерЅ░рѕЏ рІѕрѕерІ│ 11 рІѕрѕерїѕріЉ рЅ░рЅЦрѕј рЅарѕџрїарѕФрІЇ ріаріФрЅБрЅб рІе4 рѕ░рІјрЅй рѕЋрІГрІѕрЅх ріарѕЇрЇЈрѕЇрЇб

@tikvahethiopia

рЅарѕЮрѕхрѕФрЅЁ ріарЇЇрѕфріФрІірЅи рѕђрїѕрѕГ #рЅ│ріЋрІЏріњрІФ рѕѕрѕ│рѕЮріЋрЅ│рЅх рЅарІўрѕѕрЅђ ріерЅБрІх рІЮріЊрЅЦ рѕЮріГріЋрІФрЅх рЅарЅ░ріерѕ░рЅ░ рІерїјрѕГрЇЇ ріарІ░рїІ ріЦріЊ рІерѕўрѕгрЅх рѕўріЋрѕИрѕФрЅ░рЅх 155 рѕ░рІјрЅй рѕ▓рѕърЅ▒ рЇц 236 рѕ░рІјрЅй рІ░рїЇрѕъ рІерЅ░рѕѕрІФрІе рѕўрїаріЋ рІФрѕѕрІЇ рїЅрІ│рЅх ріЦріЋрІ░рІ░рѕерѕ░рЅБрЅИрІЇ рІерѕђрїѕрѕфрЅ▒ рїа/рѕџ рЅЃрѕ▓рѕЮ рѕЏрїЁрІІрѕі рЅ░ріЊрїЇрѕерІІрѕЇрЇб

рЅарІџрѕЁ рѕ│рѕЮріЋрЅх рЅарїјрѕерЅцрЅх #рігріЋрІФ рЅарІ░рѕерѕ░рІЇ рІерїјрѕГрЇЇ ріарІ░рїІ рЅарЅхріЋрѕ╣ 35 рѕ░рІјрЅй рѕўрѕърЅ│рЅИрІЇ рЅ░ріљрїЇрѕ»рѕЇрЇб 40,000 рѕ░рІјрЅй┬а рІ░рїЇрѕъ ріерЅцрЅ│рЅИрІЇ ріЦріЋрІ▓рЇѕріЊрЅђрѕЅ рѕєріљрІІрѕЇрЇб

@tikvahethiopia

